import React from "react";
import "./style.scss";

const movie_icon = require("../../img/movie_Icon.png");

const MenuBar = () => {
  return (
    <nav className="menuBarContainer">
      <ul>
        <li>
          <img src={movie_icon} alt="" />
        </li>
        <li className="menuBar__Lists">
          <p>Home</p>
          <p>series</p>
          <p>Movie</p>
          <p>Contents</p>
          <p>recommendation</p>
        </li>
        <li></li>
      </ul>
    </nav>
  );
};

export default MenuBar;
